import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default function Admin() {
    if(sessionStorage.getItem("username") == "admin"){
        window.location.href = '/admin';
      }
    else if(sessionStorage.getItem("username")){
        window.location.href = '/logenHome';
    }

    const [userCount, setUserCount] = useState(0);

    useEffect(() => {
        const fetchUserCount = async () => {
        const response = await axios.get('http://localhost:8080/users/count');
        setUserCount(response.data);
        };

        fetchUserCount();
    }, []);

    return (
        <div className='container'>
            <div className='py-4'>
                <h1>Join the community</h1>
                <h2>
                    There is a lot of us!
                </h2>
                <div>
                    {userCount}
                </div>
                <h2>
                    And were ready to have fun!
                </h2>
                <div>
                <Link className='btn btn-outline-primary' to="/adduser">Make an Account</Link>
                </div>
            </div>
        </div>
    )
    }
